import Button from "./Button"

const NavBar = () => {
    return (
        <div className='navbar'>
            <a id="aboutBtn" href='#about-me'>About</a>
            <Button id="expBtn" text='Experience' onClick="document.getElementById('experience').scrollIntoView();"/>
            <Button id="contactBtn" text='Contact' onClick="document.getElementById('footer').scrollIntoView();"/>
        </div>
    )
}

export default NavBar
